class="ncss-checkbox-container" data-sq-exempt="true"><input type="checkbox" name="PreCookie-functional" id="PreCookie-functional" readonly="" class="ncss-checkbox mr2-sm" data-sq-exempt="true" aria-describedby="PreCookie-functional-label PreCookie-functional-desc" aria-labelledby="PreCookie-functional-label PreCookie-functional-desc" data-var="functional" checked=""/><label id="PreCookie-functional-label" data-sq-exempt="true" class="ncss-label pl7-sm u-bold" for="PreCookie-functional" data-var="functionalLabel"><span data-sq-exempt="true" id="hf_cookie_label_functional">Functional</span></label></div><p class="body-2 pl7-sm" id="PreCookie-functional-desc"><span data-sq-exempt="true" id="hf_cookie_text_functional">These cookies are required for basic site functionality and are therefore always enabled. These include cookies that allow you to be remembered as you explore the site within a single session or, if you request, from session to session. They help to make the bag and checkout process possible as well as assisting in security issues and conforming to regulations.</span></p></div></div><div class="ncss-row mt5-sm pre-temp-ncss4-patch" data-sq-exempt="true"><div class="ncss-col-sm-12 ncss-form-group" data-sq-exempt="true"><div class="ncss-checkbox-container" data-sq-exempt="true"><input type="checkbox" name="PreCookie-allowPerformance" id="PreCookie-allowPerformance" class="ncss-checkbox mr2-sm" data-sq-exempt="true" aria-describedby="PreCookie-allowPerformance-label PreCookie-allowPerformance-desc" aria-labelledby="PreCookie-allowPerformance-label PreCookie-allowPerformance-desc" data-var="allowPerformance" checked=""/><label id="PreCookie-allowPerformance-label" data-sq-exempt="true" class="ncss-label pl7-sm u-bold" for="PreCookie-allowPerformance" data-var="allowPerformanceLabel"><span data-sq-exempt="true" id="hf_cookie_label_performance">Performance</span></label></div><p class="body-2 pl7-sm" id="PreCookie-allowPerformance-desc"><span data-sq-exempt="true" id="hf_cookie_text_performance">These cookies allow us to improve the site’s functionality by tracking usage on the website. In some cases these cookies can improve the speed with which we can process your request as they allow us to remember site preferences that you’ve selected. De-selecting these cookies may result in poorly tailored recommendations and slow site performance.</span></p></div></div><div class="ncss-row mt5-sm pre-temp-ncss4-patch" data-sq-exempt="true"><div class="ncss-col-sm-12 ncss-form-group" data-sq-exempt="true"><div class="ncss-checkbox-container" data-sq-exempt="true"><input type="checkbox" name="PreCookie-allowMarketing" id="PreCookie-allowMarketing" class="ncss-checkbox mr2-sm" data-sq-exempt="true" aria-describedby="PreCookie-allowMarketing-label PreCookie-allowMarketing-desc" aria-labelledby="PreCookie-allowMarketing-label PreCookie-allowMarketing-desc" data-var="allowMarketing" checked=""/><label id="PreCookie-allowMarketing-label" data-sq-exempt="true" class="ncss-label pl7-sm u-bold" for="PreCookie-allowMarketing" data-var="allowMarketingLabel"><span data-sq-exempt="true" id="hf_cookie_label_socialMedia">Social Media and Advertising</span></label></div><p class="body-2 pl7-sm" id="PreCookie-allowMarketing-desc"><span data-sq-exempt="true" id="hf_cookie_text_socialMedia_2">Social media cookies offer the possibility for you to connect to your social networks and share content from our website through social media. Advertising cookies (from third parties) collect information to help better tailor advertising to your interests, both within and beyond Nike websites. In some cases, these cookies involve the processing of your personal data. For more information about this processing of personal data, check our <a target="_blank" class="pre-privacy-policy-link" rel="noopener noreferrer" href="http://agreementservice.svs.nike.com/in/en_gb/rest/agreement?agreementType=privacyPolicy&amp;uxId=com.nike.commerce.nikedotcom.web&amp;country=in&